import React, { useState, useEffect } from 'react'
import AdminCharts from '../Components/AdminCharts'

function ProductReview(props) {
    let ProductData = props.proData || [];

    useEffect(() => {
        // Log the data on page load or when productData is received
        console.log("Product data on page load:", ProductData);
    }, [ProductData]); // Effect runs when productData changes

    return (
        <div className="productReviewBody">
            {ProductData.map((prod, index) => (
                <div className="clickProductChart">
                    <AdminCharts
                        imgSrc={prod.thumbnail}
                        title={prod.name}
                        price={prod.price}
                        desc={prod.description}
                        rate={prod.rate}
                        brand={prod.brand}
                        market={prod.compare}
                        category={prod.category}
                        subCategory={prod.subCategory}
                    />
                </div >

            ))
            }
        </div>
    )
}

export default ProductReview
